import React from 'react';
import ChatBot from 'react-simple-chatbot';

const steps = [
  {
    id: '0',
    message: 'Bom dia'
  }
]

function App() {
  return (
   <ChatBot headerTitle={'ola'} steps={steps}></ChatBot>
  );
}

export default App;
